    store = [0] * n
    store1 = [-1] * n
    d = {}
    store[0] = 1 if s[0] == '(' else -1
    d[store[-1]] = 1
    for i in range(1, n):
        if s[i] == '(':
            store[i] = store[i - 1] + 1
            d[store[i]] = i + 1
        else:
            store[i] = store[i - 1] - 1
            if store[i - 1] in d:
                store1[d[store[i - 1]] - 1] = i + 1
    post = [-1] * n
    if n > 1:
        for i in range(n - 2, -1, -1):
            if s[i] == '(':
                if store1[i] != -1:
                    post[i] = store1[i]
            else:
                post[i] = post[i + 1]
    results = []
    for t in queries:
        if n == 1 or (n == 2 and s != '()'):
            results.append(-1)
        else:
            results.append(post[t - 1])
    return results

